●欧州規格EN60900適合品で1000V絶縁仕様です。●様々な場面で活躍する汎用性の高い斜ニッパーです。●高品質な原材料を用いることで、精密な作業を可能にし、ツール寿命も長くなっています。●軟線・硬線を精密に切断することができます。●刃の先端では細い銅線を丁寧に切断することができます。●入念な焼入れ処理が施された刃の硬度は約ＨＲＣ６２です。●ヘッド先端は細くなっており、狭い場所での作業も可能です。<BR>●切断能力(mm)硬線:1.8●切断能力(mm)軟線:4.0●全長(mm):140●切断能力(mm)中硬線:2.5●ハンドル:コンフォートタイプ●質量(g):160<BR>●オイル焼き入れ焼き戻し処理済のバナジウム電気鋼<BR>●スチールワイヤーやワイヤーロープの切断はできません。<tr><td colspan="2">
